import React from "react";

import { WishlistIconContainer } from "./wishlist-icon.styles";
import { ReactComponent as HeartIcon } from "../../assets/wishlist.svg";
import { ReactComponent as HeartIconColored } from "../../assets/wishlist-colored.svg";

const WishListIcon = ({ inWishlist, handleClick, item }) => {
  return (
    <WishlistIconContainer onClick={() => handleClick()}>
      {inWishlist ? <HeartIconColored /> : <HeartIcon />}
    </WishlistIconContainer>
  );
};

export default WishListIcon;
